import { Button } from "@chakra-ui/react";

import "../styles/style.css";

export default function Doenca(props) {
  return (
    <div className="doenca-div">
      <h1>
        {props.numero}
        {props.nome}
        <Button colorScheme="orange">Ver mais</Button>
      </h1>
    </div>
  );
}
